import React from 'react'
import { Divider, Grid, Image } from 'semantic-ui-react'

export default function tumkampanyalar() {

    const image1=
    {
        width :"210px",
        height:"400px",
    }

    const image2=
    {
        width :"900px",
        height:"400px",
    }

    return (
        <Grid verticalAlign='middle' columns={3}>
        <Grid.Row>
          <Grid.Column>
            <Image style={image1} src='https://react.semantic-ui.com/images/wireframe/image.png' />
          </Grid.Column>
          <Grid.Column>
            <Image style={image2}  src='https://react.semantic-ui.com/images/wireframe/image.png' />
          </Grid.Column>
        </Grid.Row>
      </Grid>
    )
}
